import {React, useState} from 'react';
import ReactDOM from 'react-dom/client';
import './style.css'

function Panel({children}){
    const [className, setClassName] = useState("boxSelector");

    return(
        <div className='panel'>
            <div className='boxSelector' onClick={setClassName("boxSelector red")}></div>
            {children}
        </div>
    )
}

function App(){
    return(
        <main>
            <Panel></Panel>
            <Panel></Panel>
            <Panel></Panel>
        </main>
    )
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App></App>);
